    if n == 2:
        return 2
    if n == 3:
        return 0
    # Initialize a list with the first 4 Fib4 numbers
    fib4_list = [0, 0, 2, 0]
    # Compute the remaining Fib4 numbers using dynamic programming
    for i in range(4, n + 1):
        fib4_list.append(fib4_list[-1] + fib4_list[-2] + fib4_list[-3] + fib4_list[-4])
