    get_row([], 1) == []
    get_row([[], [1], [1, 2, 3]], 3) == [(2, 2)]
    """
    result = []
    for i in range(len(lst)):
        row = lst[i]
        if x in row:
            for j in range(len(row)-1, -1, -1):
                if row[j] == x:
                    result.append((i, j))
    return sorted(result, key=lambda x: (x[0], -x[1]))

