def minPath(grid: List[List[int]], k: int) -> List[int]:
    def dfs(row, col, k, path):
        if k == 0:
            return path
        for (dr, dc) in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            new_row, new_col = row + dr, col + dc
            if 0 <= new_row < len(grid) and 0 <= new_col < len(grid[0]) and grid[new_row][new_col] not in path:
                path.append(grid[new_row][new_col])
                if dfs(new_row, new_col, k - 1, path):
                    return path
                path.pop()
        return None

    for i in range(len(grid)):
        for j in range(len(grid[0])):
            path = dfs(i, j, k, [grid[i][j]])
            if path:
                return path
    return None

