    def dfs(x, y, k):
        if k == 0:
            return []
        if x < 0 or x >= len(grid) or y < 0 or y >= len(grid[0]):
            return None
        temp = grid[x][y]
        grid[x][y] = float('inf')
        res = dfs(x-1, y, k-1) or dfs(x+1, y, k-1) or dfs(x, y-1, k-1) or dfs(x, y+1, k-1)
        grid[x][y] = temp
        return [temp] + res if res is not None else None

    for i in range(len(grid)):
        for j in range(len(grid[0])):
            res = dfs(i, j, k)
            if res is not None:
                return res
    return []

